import React, {Component} from 'react';
import { Link } from 'react-router-dom';

import api from '../../services/api';
import './styles.css';
import SideBar from '../../components/sidebar';

import Logo from "../../images/logo.png";
import { ProSidebar, SidebarHeader, SidebarFooter, SidebarContent, Menu, MenuItem, SubMenu } from 'react-pro-sidebar';

import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, TablePagination, Button } from '@material-ui/core';
import Paper from '@material-ui/core/Paper';

export default class Propriedade extends Component {
    state = {
        propriedades: [],
    }
    
    componentDidMount() {
      this.loadPropriedades();  
    }

    loadPropriedades = async () => {
      const response = await api.get('/propriedade/listar');

      this.setState({ propriedades:  response.data.propriedades});
    }

    render() {
      const { propriedades } = this.state;
      return (
        <div className="principal">
          <div className="lado">
            <ProSidebar>
              <SidebarHeader>
                {<div>
                   <img src={Logo} className="logo-style" alt="Logo Magna" />
                 </div>
                  }
              </SidebarHeader>
              <SidebarContent>
              {
                  <Menu iconShape="square" className="menu-style">
                    <MenuItem className="item-style">Inicio</MenuItem>
                    <SubMenu className="item-style" title="Usuários">
                      <MenuItem Link to="/inicio">Todos</MenuItem>
                      <MenuItem>Novos</MenuItem>
                    </SubMenu>
                    <MenuItem Link to="/propriedades" className="item-style">Propriedades</MenuItem>
                    <MenuItem className="item-style">Talhões</MenuItem>
                  </Menu>
                }  
              </SidebarContent>
              <SidebarFooter>
                {/**
                 *  You can add a footer for the sidebar ex: copyright
                 */}
              </SidebarFooter>
            </ProSidebar>
          </div>


          <TableContainer className="table-style">
            <h1>Propriedades</h1>
            <Table className={{minWidth: 650}} aria-label="simple table">
              <TableHead>
                <TableRow>
                <TableCell align="left">ID</TableCell>
                  <TableCell align="center">Nome</TableCell>
                  <TableCell align="center">Endereco</TableCell>
                  <TableCell align="center">Comarca</TableCell>
                  <TableCell align="center">Matrícula</TableCell>
                  <TableCell align="center">Ações</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {propriedades.map((propriedade) => (
                  <TableRow key={propriedade.id}>
                    <TableCell align="th">{propriedade.id}</TableCell>
                    <TableCell align="center">{propriedade.nome}</TableCell>
                    <TableCell align="center">{propriedade.endereco}</TableCell>
                    <TableCell align="center">{propriedade.comarca}</TableCell>
                    <TableCell align="center">{propriedade.matricula}</TableCell>
                    <TableCell align="center">
                      <Button variant="outlined" className="table-button">Visualizar</Button>
                      <Button variant="outlined" className="table-button">Editar</Button>
                      <Button variant="outlined" className="table-button">Excluir</Button>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </div>
      );
    }
}
